import React from "react";

import { Link } from "react-router-dom";

const AddtoCard = () => {
  const data = localStorage.getItems('cart')

  return (
    <div className="add">



      <Link to="/productapi">Back to products</Link><br/>
      {
        data.map(item=>{
          return(
            <div>
            <>{localStorage.getItem("price")}</>
            </div>
          )
        })
      }


    </div>


  );
};

export default AddtoCard;
